import numpy as np
import cv2
import math


x = 400
z = 250
h = 80
psi = 1.52e-5
f = 0.0048
name, *data = input().split()
rx, ry, maxs, *data = [int(x) for x in data]
ar = np.zeros((65, 65, 1), dtype="uint8")
artriang = np.zeros((195, 195, 1), dtype="uint8")
for i in range(0, len(data)):
    row = int(i / 65)
    col = i - row * 65
    ar[row][col] = data[i]
    artriang[row * 3][col * 3] = data[i]
    artriang[row * 3 + 1][col * 3] = data[i]
    artriang[row * 3 + 2][col * 3] = data[i]
    artriang[row * 3][col * 3 + 1] = data[i]
    artriang[row * 3 + 1][col * 3 + 1] = data[i]
    artriang[row * 3 + 2][col * 3 + 1] = data[i]
    artriang[row * 3][col * 3 + 2] = data[i]
    artriang[row * 3 + 1][col * 3 + 2] = data[i]
    artriang[row * 3 + 2][col * 3 + 2] = data[i]


_, thresh = cv2.threshold(ar, 128, 255, cv2.THRESH_BINARY)
contours, _ = cv2.findContours(thresh, cv2.RETR_EXTERNAL, cv2.CHAIN_APPROX_SIMPLE)
for contour in contours:
    approx = cv2.approxPolyDP(contour, 0.01 * cv2.arcLength(contour, True), True)
    if len(approx) == 4:
        m = cv2.moments(contour)
        cenpolyx = int(m["m10"] / m["m00"])
        cenpolyy = int(m["m01"] / m["m00"])   # центр прямоугольника


circles = cv2.HoughCircles(thresh, cv2.HOUGH_GRADIENT, dp=1, minDist=1, param1=10, param2=15, minRadius=1, maxRadius=200)
if circles is not None:
    circles = np.round(circles[0, :]).astype("int")
    for (x, y, r) in circles:
        cencircy = y
        cencircx = x   # центр круга


artriang = cv2.GaussianBlur(artriang, (3, 3), 0)
edged = cv2.Canny(artriang, 10, 250)
closed = edged
contours, hierarchy = cv2.findContours(closed.copy(), cv2.RETR_LIST, cv2.CHAIN_APPROX_SIMPLE)
for contour in contours:
    epsilon = 0.04 * cv2.arcLength(contour, True)
    approx = cv2.approxPolyDP(contour, epsilon, True)
    if len(approx) == 3:
        m = cv2.moments(contour)
        centrix = int(m["m10"] / m["m00"])
        centriy = int(m["m01"] / m["m00"])

print("Center triangle coordinates:", centrix, centriy)
print("Center circle coordinates:", cencircx, cencircy)
print("Center poly coordinates:", cenpolyx, cenpolyy)
cv2.imshow("Detected Triangles", artriang)
cv2.waitKey(0)
cv2.destroyAllWindows()
